(566, 'operação saída segura', '2019-08-06', '2019-08-06', '05:00:00.000000', '07:30:00.000000', 'PM', 1, 'Operação a comando \r\nsupervisão geral HEIDTMANN-CMT CPC II \r\nCMT 24 ° BPM TEN CEL PORTO.\r\nOperação realizada com sucesso '),
(567, 'ORIENTAÇÕES PREVENTIVAS CONTRA INCÊNDIO E PÂNICO E ACIDENTES DOMÉSTICOS', '2019-08-06', '2019-08-06', '09:00:00.000000', '17:00:00.000000', 'CBM', 1, '\r\nObjetivo: orientar sobre a prevenção contra incêndio e pânico e acidentes domésticos mais frequentes que acometem os domicílios urbanos.\r\nPúblico alvo: moradores do bairro.\r\nLocal: passagem São Mateus.'),
(568, 'ORIENTAÇÕES PREVENTIVAS CONTRA INCÊNDIO E PÂNICO E ACIDENTES DOMÉSTICOS', '2019-08-07', '2019-08-07', '09:00:00.000000', '17:00:00.000000', 'CBM', 1, '\r\nObjetivo: orientar sobre a prevenção contra incêndio e pânico e acidentes domésticos mais frequentes que acometem os domicílios urbanos.\r\nAlvo: residenciais e mercantis do Benguí.\r\nLocal: rua Benfica.'),
(569, 'PALESTRAS E DEMONSTRAÇÕES', '2019-08-08', '2019-08-08', '09:00:00.000000', '16:00:00.000000', 'CBM', 1, 'Objetivo: explicar as principais causas e como prevenir acidentes domésticos. E repassar condutas de primeiros socorros básicos. Assim, como a demonstrações de técnicas mais adequadas às situações referentes ao palestrado.'),
(570, 'Palestras nas escolas ', '2019-08-06', '2019-08-06', '08:00:00.000000', '18:00:00.000000', 'PM', 1, 'A Comando do 24° BPM\r\nFinalizado operação \r\nJunto ao colégio Escola José Valente Ribeiro '),
(571, 'PALESTRAS E DEMONSTRAÇÕES', '2019-08-09', '2019-08-09', '09:00:00.000000', '16:00:00.000000', 'CBM', 1, 'Objetivo: explicar as principais causas e como prevenir acidentes domésticos. E repassar condutas de primeiros socorros básicos.\r\nAssim, como a demonstrações de técnicas mais adequadas às situações referentes ao palestrado.\r\nAções realizadas para os alunos e funcionários da escola Marilda Nunes, somente no período matutino para reforço das ações ocorridas no dia anterior.'),
(573, 'operação \"impacto bengui \"', '2019-08-06', '2019-08-06', '08:00:00.000000', '18:00:00.000000', 'PM', 1, 'VTR Comando da 1° Cia + VTR DISQUE Denúncia + VTR de Área '),
(577, 'Operação Saturação ', '2019-08-06', '2019-08-06', '09:30:00.000000', '16:00:00.000000', 'PM', 1, 'Feira do Benguí , conjunto catalina , comunidade  são clemente,comunidade murimitsu,Av Centenario, estrada do benguí , rua Yamada , rua ajax de Oliveira , rua Betania.\r\nA comando da cia/oficial de dia '),
(578, 'Operação Saturação /Ponto Base Policia Mais Forte ', '2019-08-06', '2019-08-06', '16:30:00.000000', '20:30:00.000000', 'PM', 1, 'Será dividida em duas etapas \r\n1 Etapa (saturação):com abordagem de veiculos e pessoas\r\n2 Etapa (PBE\'S em locais com incidência de homicídios em 2019 e rondas nos principais corredores do bairro)\r\nSupervisor ao 24°Bpm   \r\nOperação finalizado '),
