(1023, 'Operação Silêncio: Fiscalização em Bares e Similares (Cumprimento do horário permitido para o funcionamento, conforme legislação em vigor).', '2019-10-21', '2019-10-22', '00:00:00.000000', '02:00:00.000000', 'PM', 1, 'Comandante: OFICIAL DE DIA 20º BPM\r\nConcentração: BASE DA PMPA (RUA OSVALDO DE CALDAS BRITO COM O PORTAL DA AMAZÔNIA)\r\n\r\nOBS: Devido a  ocorrência de grande relevância (acompanhante policial com tomada de refém) na área do Guamá, informo que quando este oficial deslocou até o Portal da Amazônia, por volta das 00h30min, para iniciar a operação silêncio, as equipes do CBM, PC e GMB não estavam no local citado. A CMT da 2° Cia, repassou que ninguém entrou em contato com a mesma. Informo que a operação foi realizada somente com as VTR\'s do Of de dia, Adjunto e vtrs de área.\r\nOPERAÇÃO FINALIZADA.'),
